import NewScore from "../pages/NewScore/NewScore";
import EditScore from "../pages/EditScore/EditScore"; // ðŸ‘ˆ IMPORTANTE

export function AppRoutes() {
  return (
    <Routes>
      <Route path="/" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <Route path="/scores" element={<Scores />} />
      <Route path="/scores/new" element={<NewScore />} />
      <Route path="/scores/:id" element={<ScoreDetails />} />
      <Route path="/scores/edit/:id" element={<EditScore />} /> {/* ðŸ‘ˆ AQUI */}
    </Routes>
  );
}
